import Home from "../pages/Home";
import { Routes, Route, BrowserRouter } from "react-router-dom";

function App() {
  return (
    
    <BrowserRouter>
      <Routes>
        {/* Basic Routes */}
        <Route path="/" element={<Home />}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
